import React from "react";
import "../css/Gallery.css";

const Gallery = (props) => {
  const marsImages = props.marsImages;
  console.log(marsImages);

  if (marsImages === "unloaded") {
    return null;
  }

  return <div></div>;
};

export default Gallery;
